    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1955.
    The report begins by summarizing the weather conditions, water conditions, and wildfires
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, fish, and reptiles- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include timber removal. The public relations section of the report
    describes Refuge visitors and violations. N-R forms and photographs are attached.",nt"owner_org":
